import React from "react";
import MealTypeStatic from "./data/MealTypeStatic";

const Recipe = () => {
  const recipeObj = MealTypeStatic[0];
  const stepsObj = recipeObj.analyzedInstructions;
  console.log(stepsObj);

  const printSteps = stepsObj.map((step, index) => {
    return (
      <p>
        Step {index}: {(step, step)}
      </p>
    );
  });
  return (
    <>
      <div className="container recipe">
        <div className="row recipeUpper">
          <div className="col-5">
            <img src={recipeObj.image}></img>
          </div>
          <div className="col-7">
            <p>Words</p>
          </div>
        </div>
        <div className="row">
          <h1>Steps</h1>
        </div>
      </div>
    </>
  );
};

export default Recipe;
